jQuery.fn.dirtsimplecolor = (function($, CUBE_SRC) {

	var STYLING = {
		"z-index":99999,
		"position":"absolute",
		"border":"2px solid #444",
		"border-radius":"14px",
		"cursor":"pointer",
		"display":"none"
	}, 
	CUBE = new Image,
	ONE_YEAR = 60*60*24*365;
	
	CUBE.src = CUBE_SRC;

	return function(callback) {
		
		return this.each(function(i, el) {

			var button = $(el),
				button_offset = button.offset(),
				down = false,
				canvas = document.createElement('canvas'),
				ctx = canvas.getContext('2d');

			canvas.id = 'dirt-simple-color-'+i;
			canvas.width = canvas.height = 200;
			CUBE.onload = function() { 
				ctx.drawImage(CUBE, 0,0); 
			};
			
			$(canvas)
				.css(STYLING)
				.css('top', button_offset.top+button.height()+6)
				.css('left', button_offset.left)
				.on('selectstart', function(e) { e.preventDefault(); }) // prevent cursor change on drag
				.mousedown(function(e) { down = true; })
				.mousemove(function(e) { if (down) update_color(e.offsetX, e.offsetY); })
				.mouseup(function(e) { down = false; update_color(e.offsetX, e.offsetY, true); })
				.mouseout(function(e) { down = false; })
				.appendTo(document.body);
				
			button.click(function(e) {
				e.preventDefault();
				$(this).toggleClass('dirtsimplecolor_open');
				$(canvas).toggle();
			});

			var cookie_val = document.cookie.match(canvas.id+"=(.+?)(;|$)"),
				COLOR = cookie_val && cookie_val.length ? cookie_val[1] : '0,0,0'; // default black

			callback(COLOR);

			function update_color(x,y, save) {

				var d = ctx.getImageData(x,y,1,1);

				if (d instanceof ImageData) {
					COLOR = [].slice.call(d.data,0,3);

					if (save) {
						var expire = Date.now()+ONE_YEAR; // a year
						document.cookie = canvas.id+"="+COLOR+";max-age="+expire+";"
					}

					callback(COLOR);
				}
			}
		
		});
		
	};

})(jQuery,"data:image/png;base64,");
